class ArticleBean {
  DataBean data;
  int errorCode;
  String errorMsg;

  static ArticleBean fromMap(Map<String, dynamic> map) {
    if (map == null) return null;
    ArticleBean articleBeanBean = ArticleBean();
    articleBeanBean.data = DataBean.fromMap(map['data']);
    articleBeanBean.errorCode = map['errorCode'];
    articleBeanBean.errorMsg = map['errorMsg'];
    return articleBeanBean;
  }

